import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [bicycles, setBicycles] = useState([]); // State to hold bicycle data

  useEffect(() => {
    // Fetch data from the backend
    axios.get('http://localhost:8081/bicycles') // Use the correct API endpoint
      .then(response => {
        console.log(response.data); // Log data for debugging
        setBicycles(response.data); // Update state with fetched data
      })
      .catch(error => console.error('Error fetching bicycles:', error));
  }, []);

  return (
    <div>
      <h1>Bicycles</h1>
      <ul>
        {bicycles.map(bicycle => (
          <li key={bicycle.bicycleID}>
            <strong>Type:</strong> {bicycle.bicycleType || 'Unknown'}<br />
            <strong>Short Description:</strong> {bicycle.bicycleShortDescription || 'Not provided'}<br />
            <strong>Long Description:</strong> {bicycle.bicycleLongDescription || 'Not provided'}<br />
            <strong>Status:</strong> {bicycle.bicycleStatus || 'Unknown'}<br />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default App;
